  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kodiak NWR outlines
  Refuge accomplishments from January through April of 1955. The report begins by
  summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, and mammals- is also covered. The Refuge development and maintenance section
  discusses physical developments and wildfires. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes Refuge visitors, Refuge participation, hunting, and fishing.\",\n\t\"license_title\":
